import React from 'react';

function MainControls() {
    return (
        <Grid 
            container 
            spacing={0}
            direction="column"
            justify="center"
            align-items="center"
            style={{height: "100%"}}
        >
            <Grid item xs={4} style={{backgroundColor:"#abc123"}}>
            </Grid>
            <Grid item xs={4} style={{backgroundColor:"#292f6a"}}>
            </Grid>
            <Grid item xs={4} style={{backgroundColor:"#a1b2c3"}}>
            </Grid>
        </Grid>
    );
}

export default MainControls;
